import './App.css';
import { useState } from "react";

function App() {

  const [text, setText] = useState("");

  return (
    <div className="App">
      <header className="App-header">
        <h1 className="Text-H"> ICE CREAM CABINET </h1>
        <h6 class>username</h6>
        <input
        type="text"
        value={text}
        onChange={(e) => setText(e.target.value)}
        placeholder="username"
        className= "Input-Box"
        >
        </input>
        <h6>password</h6>
        <input
        type="text"
        value={text}
        onChange={(e) => setText(e.target.value)}
        placeholder="password"
        className= "Input-Box"
        >
        </input>
      </header>
    </div>
  );
}

export default App;
